http://www.w3.org/2000/01/rdf-schema#com.value:
Le sommet de l'ASEAN est une réunion annuelle tenue entre les pays membres de l'Association des nations de l'Asie du Sud-Est. Il est notamment question de développement et d'échange culturel. À l'occasion du 11e sommet qui s'est tenu les 12-14 décembre 2005 à Kuala Lumpur en Malaisie, les discussions se sont portées sur : 
* la propagation de la grippe aviaire ; 
* le conflit dans le sud de la Thaïlande ; 
* la démocratie en Birmanie ; 
* la montée des prix du pétrole et la pauvreté ; 
* la charte de l'ASEAN.

